import { NavLink } from "react-router-dom";
import classes from './MainHeader.module.css'

const MainHeader = () => {
	return (
		<header className={classes.header}>
			<nav>
				<ul>
					<li>
						<NavLink to='/welcome'
							style={{ color: 'blue' }}
							activeStyle={{ color: 'green' }}
							style={({ isActive }) => ({ color: isActive ? 'green' : 'blue' })}
						>Welcome</NavLink>
					</li>
					<li>
						<NavLink to='/products'
							style={{ color: 'blue' }}
							activeStyle={{ color: 'green' }}
							style={({ isActive }) => ({ color: isActive ? 'green' : 'blue' })}
						>Products</NavLink>
					</li>
				</ul>
			</nav>
		</header>
	)
}

export default MainHeader;
